import React from "react";
import styled from "styled-components";


const TimeSlot = ({onClick, index, time, isPossible}) => {
    if (isPossible) {
        return (
            <button onClick={onClick} key={index} value={time} data-isPossible={isPossible}>possible</button>
        );
    } else {
        return (
            <button onClick={onClick} key={index} value={time} data-isPossible={isPossible}>impossible</button>
        );
    }

}

export default TimeSlot;
